import React, { Component } from 'react';
import RoundAbout from './RoundAbout';

export default class Login extends Component {
    render() {
        console.log('this props', this.props);
        return (
         <div>
             { this.props.showModal ? <Modal /> : null }
            <RoundAbout />
        </div>
        )
    }
}
